export enum SkillIcon {
  "react",
  "typescript",
  "javascript",
  "html",
  "css",
  "sass",
  "tailwind",
  "git",
  "wordpress",
  "mongodb",
  "figma",
  "expressjs",
  "docker",
  "webflow",
  "strapi",
  "redux",
  "github-actions",
}

export function getSkillIcon(name: keyof SkillIcon) {
  switch (name) {
    case "react":
      return reactIcon;
    case "typescript":
      return typescriptIcon;
    case "javascript":
      return javascriptIcon;
    case "html":
      return htmlIcon;
    case "css":
      return cssIcon;
    case "sass":
      return sassIcon;
    case "tailwind":
      return tailwindIcon;
    case "git":
      return gitIcon;
    case "wordpress":
      return wordpressIcon;
    case "mongodb":
      return mongodbIcon;
    case "figma":
      return figmaIcon;
    case "expressjs":
      return expressIcon;
    case "docker":
      return dockerIcon;
    case "webflow":
      return webflowIcon;
    case "strapi":
      return strapiIcon;
    case "redux":
      return reduxIcon;
    case "github-actions":
      return githubIcon;
  }
}